INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, 0, "【物理】中衛で、味方をプリンで強化する幽霊聖少女。\n物理攻撃力と物理クリティカルアップのプリンパワーの\nフィールドで自分のスキルも強化し、猛攻を繰り出す。", 119901, 1, 119901, "ミヤコ（クリスマス）", 0, "2024/12/31 11:59:59", 302, 2.17, 119901, 119901, 3, 0, "2024/12/22 12:00:00", 450, 14, 1, 1, 0, 1, "みやこ");
INSERT INTO `v1_631c51e0d87fdba9b3a71e5e8d87d53a16819ffec73d82ee2249907ebc931260` VALUES (0, 0, 0, "【物理】前衛で猛攻から味方を守護する闇のお姉ちゃん。\nバトル開始時の行動不能無効スキルで周囲の味方を守り、\n範囲を束縛するスキルで敵を牽制し、戦況を一変する。", 120001, 5, 120001, "シズル（ノワール）", 0, "2024/03/28 11:59:59", 190, 2.375, 120001, 120001, 3, 0, "2024/03/22 12:00:00", 450, 6, 5, 1, 0, 1, "しずる");
